import uuid from 'uuid/v1'

const initialState ={
    transactions: [
        {
            id: uuid(),
            title: "Sainsbury's",
            amount: -33.75,
            date: Date.now()
        },
        {
            id: uuid(),
            title: "Greggs",
            amount: -15.25,
            date:Date.now()
        },
        {
            id: uuid(),
            title: "Mission Burrito",
            amount: -7.23,
            date:Date.now()
        },
        {
            id: uuid(),
            title: "Fishies",
            amount: -100,
            date:Date.now()
        },
    ]
}
